I can suggest several more robust methods to handle API selection:

1. Using a Factory Pattern:
```python
class APIFactory:
    @staticmethod
    def get_api(api_name):
        api_mapping = {
            'API_Call': API_Call,
            'API_Call_2': API_Call_2
        }
        if api_name not in api_mapping:
            raise ValueError(f"Invalid API name: {api_name}")
        return api_mapping[api_name]()

# In your Flask app:
class APIManager:
    def __init__(self):
        self.current_api = None
        self.factory = APIFactory()

    def update_api(self, api_name):
        self.current_api = self.factory.get_api(api_name)

    def get_current_api(self):
        return self.current_api

api_manager = APIManager()
api_manager.update_api('API_Call_2')  # Set default

@app.route('/select-api', methods=['POST'])
def select_api():
    data = request.json
    api_name = data.get('api_name')
    try:
        api_manager.update_api(api_name)
        return jsonify
